import styles                   from './SummaryTable.css';
import { useState }             from 'react';

export const SummaryTable = ({ test, tags, handleDelete }) => {

    return (
        <table id="questions__table">
            <tbody>
                <tr className="space_under">
                    <th> Summary </th>
                </tr>
                

                {test.map((prop, i) => (
                <>
                    <td className="question_id" key={prop}> {prop} </td>
                </> ))}
            
            </tbody>
        </table>
    )
};
